import Table from 'react-bootstrap/Table';
import { useState, useEffect } from 'react';

export const TableData = (props) => {
  const headers = ['First Name', 'Last Name', 'User Name'];
  const data = [
    {
      nombre: 'Luis Robles',
      tipo_alimento: 'desayuno',
      hora: '6:45',
      ubicacion: 'parque solidaridad',
      '': '',
    },
    {
      nombre: 'Gloria estrada',
      tipo_alimento: 'desayuno',
      hora: '7:00',
      ubicacion: 'deportivo contra',
      '': '',
    },
    {
      nombre: 'Luis Robles',
      tipo_alimento: 'comida',
      hora: '15:00',
      ubicacion: 'estación centro',
      '': '',
    },
  ];
  const [keys, setKeys] = useState([]);
  useEffect(() => {
    if (data) {
      console.log(Object.keys(data[0]).filter((key) => key != ''));
      setKeys(Object.keys(data[0]).filter((key) => key != ''));
    }
  }, []);
  return (
    <Table striped bordered hover size='sm'>
      <thead>
        <tr>
          <th>#</th>
          {headers.map((header, index) => (
            <th key={header + index}>{header}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {data.map((item, index) => (
          <tr key={'row+' + index}>
            {keys.map((id, subIndex) => (
              <td key={item[id] + index}>{item[id]}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </Table>
  );
};

export default TableData;
